import React from "react";
import { Link } from 'react-router-dom';


const Navbar = () => {
    return(
        <nav>
            <div className='container'>
                <Link to='/home' className="logo">Ecommerce</Link>
                <Link to='/cart' className="cart"><ion-icon name="cart-outline"></ion-icon></Link>
            </div>
        </nav>
    )
}

export default Navbar
